int main()
{
	int m;
	while(cin>>m)
	{
		int a,b,c=m;
	    for(int i=1;i<=m/2;i++)
	    {
			if(hash[i-1]&&hash[m-i-1])
			{
				if(m-2*i<c)
				{
					c=m-2*i;
					a=i;
					b=m-i;
				}
			}
		}
		cout<<a<<" "<<b<<endl;
	}
	return 0;
}
